import React from 'react'
import logo from '../images/logo1.png'
const Navbar = () => {
  return (
    <div>
        <nav className='bg-bgDark py-4'>
            <img src={logo} sizes=''></img>
        </nav>
    </div>
  )
}

export default Navbar
